import PropTypes from "prop-types";
import styles from "./Btn.module.css";

function Btn({ text, onClick }) {
  return (
    <button className={styles.Btn} onClick={onClick}>
      {text}
    </button>
  );
}

Btn.propTypes = { text: PropTypes.string.isRequired };
export default Btn;
